},{\"languageCode\":\"so\",\"languageName\":{\"simpleText\":\"Somali\"}},{\"languageCode\":\"st\",\"languageName\":{\"simpleText\":\"Southern Sotho\"}},{\"languageCode\":\"es\",\"languageName\":{\"simpleText\":\"Spanish\"}},{\"languageCode\":\"su\",\"languageName\":{\"simpleText\":\"Sundanese\"}},{\"languageCode\":\"sw\",\"languageName\":{\"simpleText\":\"Swahili\"}},{\"languageCode\":\"sv\",\"languageName\":{\"simpleText\":\"Swedish\"}},{\"languageCode\":\"tg\",\"languageName\":{\"simpleText\":\"Tajik\"}},{\"languageCode\":\"ta\",\"languageName\":{\"simpleText\":\"Tamil\"}},{\"languageCode\":\"tt\",\"languageName\":{\"simpleText\":\"Tatar\"}},{\"languageCode\":\"te\",\"languageName\":{\"simpleText\":\"Telugu\"}},{\"languageCode\":\"th\",\"languageName\":{\"simpleText\":\"Thai\"}},{\"languageCode\":\"tr\",\"languageName\":{\"simpleText\":\"Turkish\"}},{\"languageCode\":\"tk\",\"languageName\":{\"simpleText\":\"Turkmen\"}},{\"languageCode\":\"uk\",\"languageName\":{\"simpleText\":\"Ukrainian\"}},{\"languageCode\":\"ur\",\"languageName\":{\"simpleText\":\"Urdu\"}},{\"languageCode\":\"ug\",\"languageName\":{\"simpleText\":\"Uyghur\"}},{\"languageCode\":\"uz\",\"languageName\":{\"simpleText\":\"Uzbek\"}},{\"languageCode\":\"vi\",\"languageName\":{\"simpleText\":\"Vietnamese\"}},{\"languageCode\":\"cy\",\"languageName\":{\"simpleText\":\"Welsh\"}},{\"languageCode\":\"fy\",\"languageName\":{\"simpleText\":\"Western Frisian\"}},{\"languageCode\":\"xh\",\"languageName\":{\"simpleText\":\"Xhosa\"}},{\"languageCode\":\"yi\",\"languageName\":{\"simpleText\":\"Yiddish\"}},{\"languageCode\":\"yo\",\"languageName\":{\"simpleText\":\"Yoruba\"}},{\"languageCode\":\"zu\",\"languageName\":{\"simpleText\":\"Zulu\"}}],\"defaultAudioTrackIndex\":0}},\"videoDetails\":{\"videoId\":\"Atzow2jQPDg\",\"title\":\"I-Team: It Takes a Real SEAL to Track Down the Fakes\",\"lengthSeconds\":\"378\",\"keywords\":[\"FOX 5 Atlanta\",\"I-Team\",\"WAGA\",\"FOX 5\",\"Randy Travis\",\"FOX 5 News\",\"FOX 5 Atlanta I-Team\",\"Investigation\",\"Navy SEAL\",\"Stolen Valor\",\"Don Shipley\",\"Navy senior chief petty officer Don Shipley\",\"SEAL\",\"Bob McDaniel\",\"Semper Fi\",\"rear admiral\",\"Delta Force\",\"Marine\",\"Military\"],\"channelId\":\"UCjHWv2DU5-HLpogAAr386DQ\",\"isOwnerViewing\":false,\"shortDescription\":\"WOODSTOCK, Ga. - You don’t have to be a military veteran to be bothered by the thought of someone posing as a Navy SEAL.\\n\\nBut when you’re a retired member of that elite fighting group, aggravation can lead to motivation – and to spending the rest of your life outing the fakes.\\n\\nRetired Navy senior chief petty officer Don Shipley spent nearly 20 years as a Navy SEAL. Around 2008, he says he found a new calling in retirement: catching people who pretend to be a SEAL. And he says our state holds a dubious place of honor.\\n\\n“Georgia is the Number 1 state in this nation for imposters,\\\" he said. \\\"SEAL imposters.”\\n\\n“Why do we rate so high?\\\" I asked. \\\"Or maybe, so low?\\\"\\n\\n\\\"I really don’t have any idea.”\\n\\nMaybe it’s our many military installations. Maybe it’s our climate, he said. All Don Shipley knows is Georgians seem to show up more than any other fakes from the thousands of tips that pour into his home office in Maryland.\\n\\nPeople like Bob McDaniel of Cobb County. In October, McDaniel walked into the Semper Fi Bar and Grille in Woodstook to celebrate the Navy’s birthday. He wore the uniform of a rear admiral with a chest full of medals. The restaurant posted pictures on their Facebook page, including a video of him giving a toast.\\n\\nTrouble is, the military said McDaniel never served in the Navy. Or fought with Delta Force. Or flew combat missions for the Marine Corps in Vietnam. Yet that's what he tells people who pay for his self-defense classes taught all over metro Atlanta.\\n\\nAccording to the military, McDaniel only spent six years in the Marine Corps reserve, never saw combat and finished as an E-5 sergeant.\\n\\nAdd one more to Shipley's list of fakes.\\n\\nThe Maryland native joined the Navy in 1978, eventually graduating from SEAL training in 1985. The prestigious unit – designed to fight on Sea, Air or Land – started during World War II.\\n\\nShipley, 58, retired in 2003 after serving with SEAL Team 1 and SEAL Team 2 on missions around the world. He also spent years teaching Basic Underwater Demolition\/SEAL (BUD\/S). \\n\\nHe says after a fake Marine fooled him years ago, he decided to turn the tables. With the help of a private database of all SEAL graduates, Shipley said he and his wife Diane catch an average of a dozen posers each day. He even started a YouTube channel where he posted his phone confrontations, creating the Phony Navy SEAL of the Week.\\n\\nNow 58, Shipley’s so popular -- with so many verification requests pouring in -- he set up Videos Extreme SEAL Experience. He now charges $20 per search, free if you become a paying member of his website where you get access to all his videos and read about the biggest scammers.\\n\\nHe doesn’t just expose fake SEALs. Anyone lying about their military record is fair game.\\n\\nHe says he’s outed law enforcement officers who lied about their military heroics. World War II vets. He’s even spotted Civil War fakes who bragged in old newspapers.\\n\\nBut these days – instead of outing people over the phone or in his blog -- Shipley likes paying a personal visit.\\n\\nRemember Bob the pretend Navy rear admiral and phony SEAL? Here’s what Shipley said to Bob McDaniel about the medals he was wearing in those pictures last month.\\n\\n“First of all…” said McDaniel. “I can’t explain it right now.” He walked away. A few days later, McDaniel returned a call from the FOX 5 I-Team and admitted that he had lied about his military past. He maintained it was not \\\"Stolen Valor,\\\" a federal law that makes it a crime for someone to fake their military credentials to get \\\"any tangible benefit.\\\"\\n\\n\\\"I hope I don't have to seek legal counsel,\\\" said McDaniel. \\\"I didn't break any laws.\\\" He could offer no reason why he created such dramatic stories. He said he wore the Navy admiral uniform to honor his late father, even though his dad wasn't an admiral either.\\n\\n\\\"It is absolutely my fault,\\\" he said about his long list of false claims. \\\"I will never, ever do anything like that again. I'm so embarrassed. I never tried to steal valor. I never tried to do anything like that.\\\"\\n\\nWhat brought Shipley to Georgia was that picture on the restaurant Facebook page. An excited North Forsyth high school Navy sea cadet stood beaming next to Bob McDaniel.\\n\\nWe both stood there watching Bob McDaniel drive away, finally confronted with the truth. Shipley raised his left hand to his forehead.\\n\\n“We’ll give him the left-handed salute,” Shipley said with a laugh. “That’s all he rates.”\\n\\n\\nFULL STORY: https:\/\/www.fox5atlanta.com\/news\/it-takes-a-real-seal-to-track-down-the-fakes\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/Atzow2jQPDg\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLBbwpbJQR6aTYrNutpEOQn80jLzIA\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/Atzow2jQPDg\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLCm60SpznmMHtAjz7TGWuOK3tC_9A\",\"width\":196,\"height\":110},{\"url\":\"https:\/\/i.ytimg.com\/vi\/Atzow2jQPDg\/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLC5fYwjfwlm99I3ScZESImLB9PFHg\",\"width\":246,\"height\":138},{\"url\":\"https:\/\/i.ytimg.com\/vi\/Atzow2jQPDg\/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLCCtyKIohAGXUaIr9EVz-O2KAbHzg\",\"width\":336,\"height\":188},{\"url\":\"https:\/\/i.ytimg.com\/vi\/Atzow2jQPDg\/maxresdefault.jpg\",\"width\":1920,\"height\":1080}]},\"averageRating\":4.905055,\"al nsPorting\":{\"getSharePanelCommand\":{\"clickTrackingParams\":\"CAAQu2kiEwjZrIT50prqAhUmFvEFHbRyAcM=\",\"commandMetadata\":{\"webCommandMetadata\":{\"url\":\"\/service_ajax\",\"sendPost\":true,\"apiUrl\":\"\/youtubei\/v1\/share\/get_web_player_share_panel\"}},\"webPlayerShareEntityServiceEndpoint\":{\"serializedShareEntity\":\"CgtBdHpvdzJqUVBEZw%3D%3D\"}},\"subscribeCommand\":{\"clickTrackingParams\":\"CAAQu2kiEwjZrIT50prqAhUmFvEFHbRyAcM=\",\"commandMetadata\":{\"webCommandMetadata\":{\"url\":\"\/service_ajax\",\"sendPost\":true,\"apiUrl\":\"\/youtubei\/v1\/subscription\/subscribe\"}},\"subscribeEndpoint\":{\"channelIds\":[\"UCjHWv2DU5-HLpogAAr386DQ\"],\"params\":\"EgIIBxgA\"}},\"unsubscribeCommand\":{\"clickTrackingParams\":\"CAAQu2kiEwjZrIT50prqAhUmFvEFHbRyAcM=\",\"commandMetadata\":{\"webCommandMetadata\":{\"url\":\"\/service_ajax\",\"sendPost\":true,\"apiUrl\":\"\/youtubei\/v1\/subscription\/unsubscribe\"}},\"unsubscribeEndpoint\":{\"channelIds\":[\"UCjHWv2DU5-HLpogAAr386DQ\"],\"params\":\"CgIIBxgA\"}},\"addToWatchLaterCommand\":{\"clickTrackingParams\":\"CAAQu2kiEwjZrIT50prqAhUmFvEFHbRyAcM=\",\"commandMetadata\":{\"webCommandMetadata\":{\"url\":\"\/service_ajax\",\"sendPost\":true,\"apiUrl\":\"\/youtubei\/v1\/browse\/edit_playlist\"}},\"playlistEditEndpoint\":{\"playlistId\":\"WL\",\"actions\":[{\"addedVideoId\":\"Atzow2jQPDg\",\"action\":\"ACTION_ADD_VIDEO\"}]}},\"removeFromWatchLaterCommand\":{\"clickTrackingParams\":\"CAAQu2kiEwjZrIT50prqAhUmFvEFHbRyAcM=\",\"commandMetadata\":{\"webCommandMetadata\":{\"url\":\"\/service_ajax\",\"sendPost\":true,\"apiUrl\":\"\/youtubei\/v1\/browse\/edit_playlist\"}},\"playlistEditEndpoint\":{\"playlistId\":\"WL\",\"actions\":[{\"action\":\"ACTION_REMOVE_VIDEO_BY_VIDEO_ID\",\"removedVideoId\":\"Atzow2jQPDg\"}]}}}}},\"storyboards\":{\"playerStoryboardSpecRenderer\":{\"spec\":\"https:\/\/i9.ytimg.com\/sb\/Atzow2jQPDg\/storyboard3_L$L\/$N.jpg?sqp=-oaymwECSEGi85f_AwYI497V7gU=|48#27#100#10#10#0#default#rs$AOn4CLA88fcqqb8u28QHLcEpBKPg9ofE7Q|80#45#77#10#10#5000#M$M#rs$AOn4CLCrUNjN8nvBKKA4pVvTyN4Z_C5J_g|160#90#77#5#5#5000#M$M#rs$AOn4CLBlLW0Ga0xkoiFTal5tiCAQZZg3hg\"}},\"microformat\":{\"playerMicroformatRenderer\":{\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/Atzow2jQPDg\/maxresdefault.jpg\",\"width\":1280,\"height\":720}]},\"embed\":{\"iframeUrl\":\"https:\/\/www.youtube.com\/embed\/Atzow2jQPDg\",\"flashUrl\":\"http:\/\/www.youtube.com\/v\/Atzow2jQPDg?version=3\\u0026autohide=1\",\"width\":1280,\"height\":720,\"flashSecureUrl\":\"https:\/\/www.youtube.com\/v\/Atzow2jQPDg?version=3\\u0026autohide=1\"},\"title\":{\"simpleText\":\"I-Team: It Takes a Real SEAL to Track Down the Fakes\"},\"description\":{\"simpleText\":\"WOODSTOCK, Ga. - You don’t have to be a military veteran to be bothered by the thought of someone posing as a Navy SEAL.\\n\\nBut when you’re a retired member of that elite fighting group, aggravation can lead to motivation – and to spending the rest of your life outing the fakes.\\n\\nRetired Navy senior chief petty officer Don Shipley spent nearly 20 years as a Navy SEAL. Around 2008, he says he found a new calling in retirement: catching people who pretend to be a SEAL. And he says our state holds a dubious place of honor.\\n\\n“Georgia is the Number 1 state in this nation for imposters,\\\" he said. \\\"SEAL imposters.”\\n\\n“Why do we rate so high?\\\" I asked. \\\"Or maybe, so low?\\\"\\n\\n\\\"I really don’t have any idea.”\\n\\nMaybe it’s our many military installations. Maybe it’s our climate, he said. All Don Shipley knows is Georgians seem to show up more than any other fakes from the thousands of tips that pour into his home office in Maryland.\\n\\nPeople like Bob McDaniel of Cobb County. In October, McDaniel walked into the Semper Fi Bar and Grille in Woodstook to celebrate the Navy’s birthday. He wore the uniform of a rear admiral with a chest full of medals. The restaurant posted pictures on their Facebook page, including a video of him giving a toast.\\n\\nTrouble is, the military said McDaniel never served in the Navy. Or fought with Delta Force. Or flew combat missions for the Marine Corps in Vietnam. Yet that's what he tells people who pay for his self-defense classes taught all over metro Atlanta.\\n\\nAccording to the military, McDaniel only spent six years in the Marine Corps reserve, never saw combat and finished as an E-5 sergeant.\\n\\nAdd one more to Shipley's list of fakes.\\n\\nThe Maryland native joined the Navy in 1978, eventually graduating from SEAL training in 1985. The prestigious unit – designed to fight on Sea, Air or Land – started during World War II.\\n\\nShipley, 58, retired in 2003 after serving with SEAL Team 1 and SEAL Team 2 on missions around the world. He also spent years teaching Basic Underwater Demolition\/SEAL (BUD\/S). \\n\\nHe says after a fake Marine fooled him years ago, he decided to turn the tables. With the help of a private database of all SEAL graduates, Shipley said he and his wife Diane catch an average of a dozen posers each day. He even started a YouTube channel where he posted his phone confrontations, creating the Phony Navy SEAL of the Week.\\n\\nNow 58, Shipley’s so popular -- with so many verification requests pouring in -- he set up Videos Extreme SEAL Experience. He now charges $20 per search, free if you become a paying member of his website where you get access to all his videos and read about the biggest scammers.\\n\\nHe doesn’t just expose fake SEALs. Anyone lying about their military record is fair game.\\n\\nHe says he’s outed law enforcement officers who lied about their military heroics. World War II vets. He’s even spotted Civil War fakes who bragged in old newspapers.\\n\\nBut these days – instead of outing people over the phone or in his blog -- Shipley likes paying a personal visit.\\n\\nRemember Bob the pretend Navy rear admiral and phony SEAL? Here’s what Shipley said to Bob McDaniel about the medals he was wearing in those pictures last month.\\n\\n“First of all…” said McDaniel. “I can’t explain it right now.” He walked away. A few days later, McDaniel returned a call from the FOX 5 I-Team and admitted that he had lied about his military past. He maintained it was not \\\"Stolen Valor,\\\" a federal law that makes it a crime for someone to fake their military credentials to get \\\"any tangible benefit.\\\"\\n\\n\\\"I hope I don't have to seek legal counsel,\\\" said McDaniel. \\\"I didn't break any laws.\\\" He could offer no reason why he created such dramatic stories. He said he wore the Navy admiral uniform to honor his late father, even though his dad wasn't an admiral either.\\n\\n\\\"It is absolutely my fault,\\\" he said about his long list of false claims. \\\"I will never, ever do anything like that again. I'm so embarrassed. I never tried to steal valor. I never tried to do anything like that.\\\"\\n\\nWhat brought Shipley to Georgia was that picture on the restaurant Facebook page. An excited North Forsyth high school Navy sea cadet stood beaming next to Bob McDaniel.\\n\\nWe both stood there watching Bob McDaniel drive away, finally confronted with the truth. Shipley raised his left hand to his forehead.\\n\\n“We’ll give him the left-handed salute,” Shipley said with a laugh. “That’s all he rates.”\\n\\n\\nFULL STORY: https:\/\/www.fox5atlanta.com\/news\/it-takes-a-real-seal-to-track-down-the-fakes\"},\"lengthSeconds\":\"379\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/channel\/UCjHWv2DU5-HLpogAAr386DQ\",\"externalChannelId\":\"UCjHWv2DU5-HLpogAAr386DQ\",\"isFamilySafe\":true,\"availableCountries\":[\"AD\",\"AE\",\"AF\",\"AG\",\"AI\",\"AL\",\"AM\",\"AO\",\"AQ\",\"AR\",\"AS\",\"AT\",\"AU\",\"AW\",\"AX\",\"AZ\",\"BA\",\"BB\",\"BD\",\"BE\",\"BF\",\"BG\",\"BH\",\"BI\",\"BJ\",\"BL\",\"BM\",\"BN\",\"BO\",\"BQ\",\"BR\",\"BS\",\"BT\",\"BV\",\"BW\",\"BY\",\"BZ\",\"CA\",\"CC\",\"CD\",\"CF\",\"CG\",\"CH\",\"CI\",\"CK\",\"CL\",\"CM\",\"CN\",\"CO\",\"CR\",\"CU\",\"CV\",\"CW\",\"CX\",\"CY\", o be bothered by the thought of someone posing as a Navy SEAL.\n\nBut when you’re a retired member of that elite fighting group, aggravation can lead to motivation – and to spending the rest of your life outing the fakes.\n\nRetired Navy senior chief petty officer Don Shipley spent nearly 20 years as a Navy SEAL. Around 2008, he says he found a new calling in retirement: catching people who pretend to be a SEAL. And he says our state holds a dubious place of honor.\n\n“Georgia is the Number 1 state in this nation for imposters,\" he said. \"SEAL imposters.”\n\n“Why do we rate so high?\" I asked. \"Or maybe, so low?\"\n\n\"I really don’t have any idea.”\n\nMaybe it’s our many military installations. Maybe it’s our climate, he said. All Don Shipley knows is Georgians seem to show up more than any other fakes from the thousands of tips that pour into his home office in Maryland.\n\nPeople like Bob McDaniel of Cobb County. In October, McDaniel walked into the Semper Fi Bar and Grille in Woodstook to celebrate the Navy’s birthday. He wore the uniform of a rear admiral with a chest full of medals. The restaurant posted pictures on their Facebook page, including a video of him giving a toast.\n\nTrouble is, the military said McDaniel never served in the Navy. Or fought with Delta Force. Or flew combat missions for the Marine Corps in Vietnam. Yet that's what he tells people who pay for his self-defense classes taught all over metro Atlanta.\n\nAccording to the military, McDaniel only spent six years in the Marine Corps reserve, never saw combat and finished as an E-5 sergeant.\n\nAdd one more to Shipley's list of fakes.\n\nThe Maryland native joined the Navy in 1978, eventually graduating from SEAL training in 1985. The prestigious unit – designed to fight on Sea, Air or Land – started during World War II.\n\nShipley, 58, retired in 2003 after serving with SEAL Team 1 and SEAL Team 2 on missions around the world. He also spent years teaching Basic Underwater Demolition/SEAL (BUD/S). \n\nHe says after a fake Marine fooled him years ago, he decided to turn the tables. With the help of a private database of all SEAL graduates, Shipley said he and his wife Diane catch an average of a dozen posers each day. He even started a YouTube channel where he posted his phone confrontations, creating the Phony Navy SEAL of the Week.\n\nNow 58, Shipley’s so popular -- with so many verification requests pouring in -- he set up Videos Extreme SEAL Experience. He now charges $20 per search, free if you become a paying member of his website where you get access to all his videos and read about the biggest scammers.\n\nHe doesn’t just expose fake SEALs. Anyone lying about their military record is fair game.\n\nHe says he’s outed law enforcement officers who lied about their military heroics. World War II vets. He’s even spotted Civil War fakes who bragged in old newspapers.\n\nBut these days – instead of outing people over the phone or in his blog -- Shipley likes paying a personal visit.\n\nRemember Bob the pretend Navy rear admiral and phony SEAL? Here’s what Shipley said to Bob McDaniel about the medals he was wearing in those pictures last month.\n\n“First of all…” said McDaniel. “I can’t explain it right now.” He walked away. A few days later, McDaniel returned a call from the FOX 5 I-Team and admitted that he had lied about his military past. He maintained it was not \"Stolen Valor,\" a federal law that makes it a crime for someone to fake their military credentials to get \"any tangible benefit.\"\n\n\"I hope I don't have to seek legal counsel,\" said McDaniel. \"I didn't break any laws.\" He could offer no reason why he created such dramatic stories. He said he wore the Navy admiral uniform to honor his late father, even though his dad wasn't an admiral either.\n\n\"It is absolutely my fault,\" he said about his long list of false claims. \"I will never, ever do anything like that again. I'm so embarrassed. I never tried to steal valor. I never tried to do anything like that.\"\n\nWhat brought Shipley to Georgia was that picture on the restaurant Facebook page. An excited North Forsyth high school Navy sea cadet stood beaming next to Bob McDaniel.\n\nWe both stood there watching Bob McDaniel drive away, finally confronted with the truth. Shipley raised his left hand to his forehead.\n\n“We’ll give him the left-handed salute,” Shipley said with a laugh. “That’s all he rates.”\n\n\nFULL STORY: "},{"text":"https://www.fox5atlanta.com/news/it-t...","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgBIhMIpq2E-dKa6gIVdhjxBR1CKgUYSLj4wMa2mLruAg==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?q=https%3A%2F%2Fwww.fox5atlanta.com%2Fnews%2Fit-takes-a-real-seal-to-track-down-the-fakes\u0026redir_token=SmKKedow6NDZDZDEj1qimon1u218MTU5MzA5NDg1NkAxNTkzMDA4NDU2\u0026event=video_description\u0026v=Atzow2jQPDg","rootVe":83769}},"urlEndpoint":{"url":"/redirect?q=https%3A%2F%2Fwww.fox5atlanta.com%2Fnews%2Fit-takes-a-real-seal-to-track-down-the-fakes\u0026redir_token=SmKKedow6NDZDZDEj1qimon1u218MTU5MzA5NDg1NkAxNTkzMDA4NDU2\u0026event=video_description\u0026v=Atzow2jQPDg","target":"TARGET_NEW_WINDOW","nofollow":true}}}]},"subscribeButton":{"buttonRenderer":{"style":"STYLE_DESTRUCTIVE","size":"SIZE_DEFAULT","isDisabled":false,"text":{"runs":[{"text":"Subscribe"}]},"navigationEndpoint":{"clickTrackingParams":"CJMBEJsrIhMIpq2E-dKa6gIVdhjxBR1CKgUY","commandMetadata":{"webCommandMetadata":{"ignoreNavigation":true}},"modalEndpoint":{"modal":{"modalWithTitleAndButtonRenderer":{"title":{"simpleText":"Want to subscribe to this channel?"},"content":{"simpleText":"Sign in to subscribe to this channel."},"button":{"buttonRenderer":{"style":"STYLE_BLUE_TEXT","size":"SIZE_DEFAULT","isDisabled":false,"text":{"simpleText":"Sign in"},"navigationEndpoint":{"clickTrackingParams":"CJQBEP2GBCITCKathPnSmuoCFXYY8QUdQioFGDIJc3Vic2NyaWJl","commandMetadata":{"webCommandMetadata":{"url":"https://accounts.google.com/ServiceLogin?service=y :{"simpleText":"Southern Sotho"}},{"languageCode":"es","languageName":{"simpleText":"Spanish"}},{"languageCode":"su","languageName":{"simpleText":"Sundanese"}},{"languageCode":"sw","languageName":{"simpleText":"Swahili"}},{"languageCode":"sv","languageName":{"simpleText":"Swedish"}},{"languageCode":"tg","languageName":{"simpleText":"Tajik"}},{"languageCode":"ta","languageName":{"simpleText":"Tamil"}},{"languageCode":"tt","languageName":{"simpleText":"Tatar"}},{"languageCode":"te","languageName":{"simpleText":"Telugu"}},{"languageCode":"th","languageName":{"simpleText":"Thai"}},{"languageCode":"tr","languageName":{"simpleText":"Turkish"}},{"languageCode":"tk","languageName":{"simpleText":"Turkmen"}},{"languageCode":"uk","languageName":{"simpleText":"Ukrainian"}},{"languageCode":"ur","languageName":{"simpleText":"Urdu"}},{"languageCode":"ug","languageName":{"simpleText":"Uyghur"}},{"languageCode":"uz","languageName":{"simpleText":"Uzbek"}},{"languageCode":"vi","languageName":{"simpleText":"Vietnamese"}},{"languageCode":"cy","languageName":{"simpleText":"Welsh"}},{"languageCode":"fy","languageName":{"simpleText":"Western Frisian"}},{"languageCode":"xh","languageName":{"simpleText":"Xhosa"}},{"languageCode":"yi","languageName":{"simpleText":"Yiddish"}},{"languageCode":"yo","languageName":{"simpleText":"Yoruba"}},{"languageCode":"zu","languageName":{"simpleText":"Zulu"}}],"defaultAudioTrackIndex":0}},"videoDetails":{"videoId":"Atzow2jQPDg","title":"I-Team: It Takes a Real SEAL to Track Down the Fakes","lengthSeconds":"378","keywords":["FOX 5 Atlanta","I-Team","WAGA","FOX 5","Randy Travis","FOX 5 News","FOX 5 Atlanta I-Team","Investigation","Navy SEAL","Stolen Valor","Don Shipley","Navy senior chief petty officer Don Shipley","SEAL","Bob McDaniel","Semper Fi","rear admiral","Delta Force","Marine","Military"],"channelId":"UCjHWv2DU5-HLpogAAr386DQ","isOwnerViewing":false,"shortDescription":"WOODSTOCK, Ga. - You don’t have to be a military veteran to be bothered by the thought of someone posing as a Navy SEAL.\n\nBut when you’re a retired member of that elite fighting group, aggravation can lead to motivation – and to spending the rest of your life outing the fakes.\n\nRetired Navy senior chief petty officer Don Shipley spent nearly 20 years as a Navy SEAL. Around 2008, he says he found a new calling in retirement: catching people who pretend to be a SEAL. And he says our state holds a dubious place of honor.\n\n“Georgia is the Number 1 state in this nation for imposters,\" he said. \"SEAL imposters.”\n\n“Why do we rate so high?\" I asked. \"Or maybe, so low?\"\n\n\"I really don’t have any idea.”\n\nMaybe it’s our many military installations. Maybe it’s our climate, he said. All Don Shipley knows is Georgians seem to show up more than any other fakes from the thousands of tips that pour into his home office in Maryland.\n\nPeople like Bob McDaniel of Cobb County. In October, McDaniel walked into the Semper Fi Bar and Grille in Woodstook to celebrate the Navy’s birthday. He wore the uniform of a rear admiral with a chest full of medals. The restaurant posted pictures on their Facebook page, including a video of him giving a toast.\n\nTrouble is, the military said McDaniel never served in the Navy. Or fought with Delta Force. Or flew combat missions for the Marine Corps in Vietnam. Yet that's what he tells people who pay for his self-defense classes taught all over metro Atlanta.\n\nAccording to the military, McDaniel only spent six years in the Marine Corps reserve, never saw combat and finished as an E-5 sergeant.\n\nAdd one more to Shipley's list of fakes.\n\nThe Maryland native joined the Navy in 1978, eventually graduating from SEAL training in 1985. The prestigious unit – designed to fight on Sea, Air or Land – started during World War II.\n\nShipley, 58, retired in 2003 after serving with SEAL Team 1 and SEAL Team 2 on missions around the world. He also spent years teaching Basic Underwater Demolition/SEAL (BUD/S). \n\nHe says after a fake Marine fooled him years ago, he decided to turn the tables. With the help of a private database of all SEAL graduates, Shipley said he and his wife Diane catch an average of a dozen posers each day. He even started a YouTube channel where he posted his phone confrontations, creating the Phony Navy SEAL of the Week.\n\nNow 58, Shipley’s so popular -- with so many verification requests pouring in -- he set up Videos Extreme SEAL Experience. He now charges $20 per search, free if you become a paying member of his website where you get access to all his videos and read about the biggest scammers.\n\nHe doesn’t just expose fake SEALs. Anyone lying about their military record is fair game.\n\nHe says he’s outed law enforcement officers who lied about their military heroics. World War II vets. He’s even spotted Civil War fakes who bragged in old newspapers.\n\nBut these days – instead of outing people over the phone or in his blog -- Shipley likes paying a personal visit.\n\nRemember Bob the pretend Navy rear admiral and phony SEAL? Here’s what Shipley said to Bob McDaniel about the medals he was wearing in those pictures last month.\n\n“First of all…” said McDaniel. “I can’t explain it right now.” He walked away. A few days later, McDaniel returned a call from the FOX 5 I-Team and admitted that he had lied about his military past. He maintained it was not \"Stolen Valor,\" a federal law that makes it a crime for someone to fake their military credentials to get \"any tangible benefit.\"\n\n\"I hope I don't have to seek legal counsel,\" said McDaniel. \"I didn't break any laws.\" He could offer no reason why he created such dramatic stories. He said he wore the Navy admiral uniform to honor his late father, even though his dad wasn't an admiral either.\n\n\"It is absolutely my fault,\" he said about his long list of false claims. \"I will never, ever do anything like that again. I'm so embarrassed. I never tried to steal valor. I never tried to do anything like that.\"\n\nWhat brought Shipley to Georgia was that picture on the restaurant Facebook page. An excited North Forsyth high school Navy sea cadet stood beaming next to Bob McDaniel.\n\nWe both stood there watching Bob McDaniel drive away, finally confronted with the truth. Shipley raised his left hand to his forehead.\n\n“We’ll give him the left-handed salute,” Shipley said with a laugh. “That’s all he rates.”\n\n\nFULL STORY: https://www.fox5atlanta.com/news/it-takes-a-real-seal-to-track-down-the-fakes","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/Atzow2jQPDg/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLBbwpbJQR6aTYrNutpEOQn80jLzIA","width":168,"height":94},{"url":"https://i.ytimg.com/vi/Atzow2jQPDg/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLCm60SpznmMHtAjz7TGWuOK3tC_9A","width":196,"height":110},{"url":"https://i.ytimg.com/vi/Atzow2jQPDg/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLC5fYwjfwlm99I3ScZESImLB9PFHg","width":246,"height":138},{"url":"https://i.ytimg.com/vi/Atzow2jQPDg/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLCCtyKIohAGXUaIr9EVz-O2KAbHzg","width":336,"height":188},{"url":"https://i.ytimg.com/vi/Atzow2jQPDg/maxresdefault.jpg","width":1920,"height":1080}]},"useCipher":false,"averageRating":4.905055,"allowRatings":true,"viewCount":"579497","author":"FOX 5 Atlanta","isPrivate":false,"isUnpluggedCorpus":false,"isLiveContent":false},"annotations":[{"playerAnnotationsExpandedRenderer":{"featuredChannel":{"startTimeMs":"5000","endTimeMs":"379000","watermark":{"thumbnails":[{"url":"https://i.ytimg.com/an/jHWv2DU5-HLpogAAr386DQ/featured_channel.jpg?v=55e49c42","width":52,"height":22}]},"trackingParams":"CAQQ8zciEwjZrIT50prqAhUmFvEFHbRyAcM=","navigationEndpoint":{"clickTrackingParams":"CAQQ8zciEwjZrIT50prqAhUmFvEFHbRyAcMyAml2","commandMetadata":{"webCommand 720,"flashSecureUrl":"https://www.youtube.com/v/Atzow2jQPDg?version=3\u0026autohide=1"},"title":{"simpleText":"I-Team: It Takes a Real SEAL to Track Down the Fakes"},"description":{"simpleText":"WOODSTOCK, Ga. - You don’t have to be a military veteran to be bothered by the thought of someone posing as a Navy SEAL.\n\nBut when you’re a retired member of that elite fighting group, aggravation can lead to motivation – and to spending the rest of your life outing the fakes.\n\nRetired Navy senior chief petty officer Don Shipley spent nearly 20 years as a Navy SEAL. Around 2008, he says he found a new calling in retirement: catching people who pretend to be a SEAL. And he says our state holds a dubious place of honor.\n\n“Georgia is the Number 1 state in this nation for imposters,\" he said. \"SEAL imposters.”\n\n“Why do we rate so high?\" I asked. \"Or maybe, so low?\"\n\n\"I really don’t have any idea.”\n\nMaybe it’s our many military installations. Maybe it’s our climate, he said. All Don Shipley knows is Georgians seem to show up more than any other fakes from the thousands of tips that pour into his home office in Maryland.\n\nPeople like Bob McDaniel of Cobb County. In October, McDaniel walked into the Semper Fi Bar and Grille in Woodstook to celebrate the Navy’s birthday. He wore the uniform of a rear admiral with a chest full of medals. The restaurant posted pictures on their Facebook page, including a video of him giving a toast.\n\nTrouble is, the military said McDaniel never served in the Navy. Or fought with Delta Force. Or flew combat missions for the Marine Corps in Vietnam. Yet that's what he tells people who pay for his self-defense classes taught all over metro Atlanta.\n\nAccording to the military, McDaniel only spent six years in the Marine Corps reserve, never saw combat and finished as an E-5 sergeant.\n\nAdd one more to Shipley's list of fakes.\n\nThe Maryland native joined the Navy in 1978, eventually graduating from SEAL training in 1985. The prestigious unit – designed to fight on Sea, Air or Land – started during World War II.\n\nShipley, 58, retired in 2003 after serving with SEAL Team 1 and SEAL Team 2 on missions around the world. He also spent years teaching Basic Underwater Demolition/SEAL (BUD/S). \n\nHe says after a fake Marine fooled him years ago, he decided to turn the tables. With the help of a private database of all SEAL graduates, Shipley said he and his wife Diane catch an average of a dozen posers each day. He even started a YouTube channel where he posted his phone confrontations, creating the Phony Navy SEAL of the Week.\n\nNow 58, Shipley’s so popular -- with so many verification requests pouring in -- he set up Videos Extreme SEAL Experience. He now charges $20 per search, free if you become a paying member of his website where you get access to all his videos and read about the biggest scammers.\n\nHe doesn’t just expose fake SEALs. Anyone lying about their military record is fair game.\n\nHe says he’s outed law enforcement officers who lied about their military heroics. World War II vets. He’s even spotted Civil War fakes who bragged in old newspapers.\n\nBut these days – instead of outing people over the phone or in his blog -- Shipley likes paying a personal visit.\n\nRemember Bob the pretend Navy rear admiral and phony SEAL? Here’s what Shipley said to Bob McDaniel about the medals he was wearing in those pictures last month.\n\n“First of all…” said McDaniel. “I can’t explain it right now.” He walked away. A few days later, McDaniel returned a call from the FOX 5 I-Team and admitted that he had lied about his military past. He maintained it was not \"Stolen Valor,\" a federal law that makes it a crime for someone to fake their military credentials to get \"any tangible benefit.\"\n\n\"I hope I don't have to seek legal counsel,\" said McDaniel. \"I didn't break any laws.\" He could offer no reason why he created such dramatic stories. He said he wore the Navy admiral uniform to honor his late father, even though his dad wasn't an admiral either.\n\n\"It is absolutely my fault,\" he said about his long list of false claims. \"I will never, ever do anything like that again. I'm so embarrassed. I never tried to steal valor. I never tried to do anything like that.\"\n\nWhat brought Shipley to Georgia was that picture on the restaurant Facebook page. An excited North Forsyth high school Navy sea cadet stood beaming next to Bob McDaniel.\n\nWe both stood there watching Bob McDaniel drive away, finally confronted with the truth. Shipley raised his left hand to his forehead.\n\n“We’ll give him the left-handed salute,” Shipley said with a laugh. “That’s all he rates.”\n\n\nFULL STORY: https://www.fox5atlanta.com/news/it-takes-a-real-seal-to-track-down-the-fakes"},"lengthSeconds":"379","ownerProfileUrl":"http://www.youtube.com/channel/UCjHWv2DU5-HLpogAAr386DQ","externalChannelId":"UCjHWv2DU5-HLpogAAr386DQ","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY","MA","MC","MD","ME","MF","MG","MH","MK","ML","MM","MN","MO","MP","MQ","MR","MS","MT","MU","MV","MW","MX","MY","MZ","NA","NC","NE","NF","NG","NI","NL","NO","NP","NR","NU","NZ","OM","PA","PE","PF","PG","PH","PK","PL","PM","PN","PR","PS","PT","PW","PY","QA","RE","RO","RS","RU","RW","SA","SB","SC","SD","SE","SG","SH","SI","SJ","SK","SL","SM","SN",
